import React, { useState } from 'react';
import './App.css';

const App = () => {
  // États pour les champs numériques
  const [numericalData, setNumericalData] = useState({
    kilometrage: '',
    anneeModele: '',
    nombrePortes: '',
    puissanceFiscale: ''
  });

  // États pour les champs catégoriels
  const [categoricalData, setCategoricalData] = useState({
    premiereMain: false,
    typeBoite: 'manuelle',
    typeCarburant: 'essence',
    marque: '',
    modele: '',
    etat: 'Très bon',
    origine: 'Wilmaya'
  });

  const handleNumericalChange = (e) => {
    const { name, value } = e.target;
    setNumericalData(prev => ({ ...prev, [name]: value }));
  };

  const handleCategoricalChange = (e) => {
    const { name, value, type, checked } = e.target;
    setCategoricalData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const formData = {
      ...numericalData,
      ...categoricalData
    };
    console.log('Données soumises:', formData);
    // Ici vous enverriez les données à votre API de prédiction
  };

  return (
    <div className="app">
      <h1>Prédiction du prix de voiture</h1>

      <form onSubmit={handleSubmit}>
        {/* Champs numériques */}
        <div className="form-group">
          <label>Kilométrage</label>
          <input
            type="number"
            name="kilometrage"
            value={numericalData.kilometrage}
            onChange={handleNumericalChange}
            placeholder="Ex: 50000"
          />
        </div>

        <div className="form-group">
          <label>Année-Modèle</label>
          <input
            type="number"
            name="anneeModele"
            value={numericalData.anneeModele}
            onChange={handleNumericalChange}
            placeholder="Ex: 2018"
          />
        </div>

        <div className="form-group">
          <label>Nombre de portes</label>
          <select
            name="nombrePortes"
            value={numericalData.nombrePortes}
            onChange={handleNumericalChange}
          >
            <option value="">Sélectionnez</option>
            <option value="3">3 portes</option>
            <option value="5">5 portes</option>
          </select>
        </div>

        <div className="form-group">
          <label>Puissance fiscale</label>
          <input
            type="number"
            name="puissanceFiscale"
            value={numericalData.puissanceFiscale}
            onChange={handleNumericalChange}
            placeholder="Ex: 5"
          />
        </div>

        {/* Champs catégoriels */}
        <div className="form-group checkbox-group">
          <input
            type="checkbox"
            name="premiereMain"
            checked={categoricalData.premiereMain}
            onChange={handleCategoricalChange}
            id="premiereMain"
          />
          <label htmlFor="premiereMain">Première main</label>
        </div>

        <div className="form-group">
          <label>Type de boîte</label>
          <select
            name="typeBoite"
            value={categoricalData.typeBoite}
            onChange={handleCategoricalChange}
          >
            <option value="manuelle">Manuelle</option>
            <option value="automatique">Automatique</option>
          </select>
        </div>

        <div className="form-group">
          <label>Type de carburant</label>
          <select
            name="typeCarburant"
            value={categoricalData.typeCarburant}
            onChange={handleCategoricalChange}
          >
            <option value="essence">Essence</option>
            <option value="diesel">Diesel</option>
            <option value="electrique">Électrique</option>
          </select>
        </div>

        <div className="form-group">
          <label>Marque</label>
          <input
            type="text"
            name="marque"
            value={categoricalData.marque}
            onChange={handleCategoricalChange}
            placeholder="Ex: Renault"
          />
        </div>

        <div className="form-group">
          <label>Modèle</label>
          <input
            type="text"
            name="modele"
            value={categoricalData.modele}
            onChange={handleCategoricalChange}
            placeholder="Ex: Clio"
          />
        </div>

        <div className="form-group">
          <label>État</label>
          <select
            name="etat"
            value={categoricalData.etat}
            onChange={handleCategoricalChange}
          >
            <option value="Très bon">Très bon</option>
            <option value="Bon">Bon</option>
            <option value="Moyen">Moyen</option>
          </select>
        </div>

        <div className="form-group">
          <label>Origine</label>
          <input
            type="text"
            name="origine"
            value={categoricalData.origine}
            onChange={handleCategoricalChange}
            placeholder="Ex: Wilmaya"
          />
        </div>

        <button type="submit" className="predict-btn">Prédire le prix</button>
      </form>
    </div>
  );
};

export default App;
